import React from "react";
import { UserProvider } from "./context/UserContext";
import Login from "./Login";
import UserInfo from "./UserInfo";
import Reducer from "./Reducer";

const App = () => {
  return (
    <div>
      <UserProvider>
        <UserInfo />
        <Login />
        <Reducer />
      </UserProvider>
    </div>
  );
};

export default App;
